function _(x)
{
    return document.getElementById(x);
} 
//Setting underscore equal to document.getElementById 
		
function percent()
{
    var perc = Math.round((correct/questions.length)*100);
    return perc;//gets percentage and returns to form
}

//Insert Javascript functions to renderQuestion() & to checkAnswer() here
function renderQuestion()
{
	test = _("test");
	if (pos >= questions.length)//If position is greater or equal to the number of questions
	{
		test.innerHTML = "<h2>You got "+correct+" of "+questions.length+" questions correct(" +percent() + "%)</h2>"; //Print # correct out of 20
		_("test_status").innerHTML += "<h2> Thank you for completing the quiz <h2>";//print "thank you..."
		_("test_incorrect").innerHTML += "<h2>You got  " +incorrect+ " incorrect<h2>";
		/*for (var a =0; a<wrong.length;a++)
		{
			_("test_incorrect").innerHTML += "Wrong question numbers: " +wrong[a]+ "chance it" ;
			a++;
		}*/
		pos = 0;
		correct = 0;
		return false;
	}
	
	var bar=document.getElementById("progressBar");//A progress bar value
	
	_("test_status").innerHTML = "Question "+(pos+1)+" of "+questions.length;
	
	bar.value = (pos+1)//Progress bar moves as we go through questions, starts at 1
	
	question = questions[pos][0];
	choiceA = questions[pos][1];
	choiceB = questions[pos][2];
	choiceC = questions[pos][3];
	test.innerHTML = "<h3>"+question+"</h3>";
	test.innerHTML +="<input type ='radio' name='choices' value='A' checked> "+choiceA+"<br>";//Radio button
	test.innerHTML +="<input type ='radio' name='choices' value='B' checked> "+choiceB+"<br>";//Radio button
	test.innerHTML +="<input type ='radio' name='choices' value='C' checked> "+choiceC+"<br><br>";//Radio button
	test.innerHTML += "<button onclick='checkAnswer()'>Submit Answer</button>";
}

function checkAnswer()
{
	choices = document.getElementsByName("choices");//Creates an array
	for (var i=0; i<choices.length; i++)//variable i=0, when i is less than the length of the choices, move it by one
	{
		if(choices[i].checked) //if a choice is checked
		{
			choice = choices[i].value; //take the value of that choice and put it into choice
		}
	}
	if(choice == questions[pos][4])//If the value of choices is equal to position 4
	{
		alert('Correct!');//Alert correct
		correct++;//Move your answers by one
	}
	else//or else
	{
		alert('Sorry wrong answer. The correct answer is ' + questions[pos][4]);
		
		incorrect++;
		
		
		
	}
	pos++;//Move position by one ie go on to the next question
	
	renderQuestion();//go to render question again
}





